import React, { useState, useEffect } from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { GiHamburgerMenu } from 'react-icons/gi';

const imganimal = [
  'https://cdn.pixabay.com/photo/2014/11/30/14/11/cat-551554_640.jpg',
  'https://img.freepik.com/premium-photo/happy-puppy-dog-smiling-isolated-purple-background_77749-593.jpg',
  'https://i.pinimg.com/736x/f5/97/35/f597358c6fec2c0fa44a06003b69a872.jpg',
];

const listuser = [
  { userid: 'f035', password: '123456' },
  { userid: 'u035', password: '1234' },
];

const defaultTheme = createTheme();

export default function App() {
  const [loginStatus, setLoginStatus] = useState(
    localStorage.getItem('loginStatus') || null
  );
  const [userImage, setUserImage] = useState(
    localStorage.getItem('userImage') || ''
  );

  const handleLogout = () => {
    localStorage.removeItem('loginStatus');
    localStorage.removeItem('userImage');
    setLoginStatus(null);
    setUserImage('');
    window.location.reload();
  };

  const getRandomUserImage = () => {
    const storedUserImage = localStorage.getItem('userImage');
    if (storedUserImage) {
      setUserImage(storedUserImage);
    } else {
      const randomIndex = Math.floor(Math.random() * imganimal.length);
      const newUserImage = imganimal[randomIndex];
      setUserImage(newUserImage);
      localStorage.setItem('userImage', newUserImage);
    }
  };

  useEffect(() => {
    getRandomUserImage();
  }, []);

  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    const enteredUserId = data.get('userid');
    const enteredPassword = data.get('password');

    const matchingUser = listuser.find((user) => {
      return (
        user.userid === enteredUserId && user.password === enteredPassword
      );
    });

    if (matchingUser) {
      setLoginStatus('Success');
      localStorage.setItem('loginStatus', 'Success');
      localStorage.setItem(
        'statuss',
        enteredUserId[0] === 'f' ? 'farmer' : 'union'
      );
      window.location.reload();
    } else {
      setLoginStatus('Fail');
      localStorage.setItem('loginStatus', 'Fail');
    }
  };

  return (
    <ThemeProvider theme={defaultTheme}>
      <Container component="main" maxWidth="xs">
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
          {loginStatus === 'Success' ? (
            <Box>
              <Avatar
                sx={{ m: 1, bgcolor: 'secondary.main', width: 200, height: 200 }}
              >
                <img
                  src={userImage}
                  alt="User"
                  style={{
                    width: '100%',
                    height: '100%',
                    objectFit: 'cover',
                  }}
                />
              </Avatar>
              <Typography variant="h6" color="primary" align="center">
                <div>Welcome, User</div>
                <div>
                  {localStorage.getItem('statuss') === 'farmer'
                    ? 'Farmer'
                    : 'Union'}
                </div>
              </Typography>

              <Button
                onClick={handleLogout}
                fullWidth
                variant="contained"
                sx={{ mt: 2, mb: 2 }}
              >
                Logout
              </Button>
            </Box>
          ) : (
            <>
              <div
                style={{
                  backgroundColor: '#024e9f',
                  textAlign: 'center',
                  height: 'fit-content',
                  fontSize: '28px',
                  padding: '10px',
                  fontWeight: 'bold',
                }}
              >
                P'dairy
              </div>
              <header>
                <GiHamburgerMenu
                  onClick={toggleNav}
                  style={{
                    cursor: 'pointer',
                    color: '#024e9f',
                  }}
                />
                <div className="goright"></div>
              </header>
              <Box
                component="form"
                onSubmit={handleSubmit}
                noValidate
                sx={{
                  mt: 1,
                  border: '1px solid #000',
                  padding: '15px',
                  borderRadius: '10px',
                  boxShadow: '7px 7px 15px -1px rgba(0, 0, 0, 0.81)',
                  WebkitBoxShadow: '7px 7px 15px -1px rgba(0, 0, 0, 0.81)',
                  MozBoxShadow: '7px 7px 15px -1px rgba(0, 0, 0, 0.81)',
                }}
              >
                <Typography
                  variant="h3"
                  align="center"
                  sx={{ color: 'black' }}
                >
                  Sign in
                </Typography>
                <TextField
                  margin="normal"
                  required
                  fullWidth
                  id="userid"
                  label="User ID"
                  name="userid"
                  autoComplete="userid"
                  autoFocus
                  inputProps={{
                    'aria-label': 'User ID',
                  }}
                />
                <TextField
                  margin="normal"
                  required
                  fullWidth
                  name="password"
                  label="Password"
                  type="password"
                  id="password"
                  autoComplete="current-password"
                  inputProps={{
                    'aria-label': 'Password',
                  }}
                />
                <Button
                  type="submit"
                  fullWidth
                  variant="contained"
                  sx={{ mt: 3, mb: 2 }}
                >
                  Sign In
                </Button>
                {loginStatus === 'Fail' && (
                  <Typography
                    variant="body2"
                    color="error"
                    align="center"
                  >
                    Incorrect User ID or Password. Please try again.
                  </Typography>
                )}
              </Box>
            </>
          )}
        </Box>
      </Container>
    </ThemeProvider>
  );
}
